import React from 'react';
import ReactDOM from 'react-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { Container,
         Row,
         Col } from 'reactstrap';
import Slider from './Slider';
import Timeline from './Timeline';
import FlightFlat from '../Projects/FlightFlat';
import Tab from './Tab';


class Home extends React.Component {
  constructor(props : any) {
    super(props);
  }

  render() {
    return (
      <Container fluid>
        <Row>
          <Col style={{height : '60vh', backgroundColor: '#ffffff'}}>

          </Col>
        </Row>
        <Container sm={{size : 6}}>
          <Row>
            <Col>
              <Timeline/>
            </Col>
          </Row>
        </Container>
        <Row>
          <Col>
            <Slider/>
          </Col>
        </Row>
        <Row>
          <div id='map' style={{position:'relative', width:'100%',height:'100vh'}}>
            <FlightFlat/>
          </div>
        </Row>
    </Container>
    );
  }
}

export default Home;
